import { Link } from 'react-router-dom';
import { observer } from 'mobx-react-lite';
import { useStore } from '../../app/stores/rootStore';
import NavBarDropDownLink from './NavBarDropDownLink';

const NavBarItems = () => {
  const { menuStore } = useStore();
  return (
    <div
      className={
        menuStore.isMenuOpen
          ? 'grid grid-rows-4 text-center items-center bg-gray-100'
          : 'hidden'
      }
      onClick={menuStore.toggleMenu}
    >
      <NavBarDropDownLink linkName={'Link #1'} linkPath={'/Link1'} />
      <Link to="/" className="p-4 hover:bg-gray-200">
        Home
      </Link>
      <Link to="/menu" className="p-4 hover:bg-gray-200">
        Menu
      </Link>
      <Link to="/about" className="p-4 hover:bg-gray-200">
        About
      </Link>
      <Link to="/contact" className="p-4 hover:bg-gray-200">
        Contact
      </Link>
    </div>
  );
};

export default observer(NavBarItems);
